outputs:
{"answer": "The costs of care services in Brighton and Hove for the year 2022-23 are set at **£624 per week** for in-city care homes for individuals aged 65 and over, and **£833.19 per week** for in-city care homes with nursing, which includes a Funded Nursing Care (FNC) component of **£209.19**.

Residents pay for these services through a combination of personal funds and local authority support, depending on their financial situation. The Adult Social Care Charging Reform, planned for October 2025, aims to introduce a more generous means test and a cap on care costs at **£86,000**, allowing individuals who fund their own care to request the local authority to arrange it on their behalf.

For more detailed information or assistance, residents can visit the Brighton & Hove City Council's Adult Social Care webpage at [https://www.brighton-hove.gov.uk/adult-social-care/about-adult-social-care](https://www.brighton-hove.gov.uk/adult-social-care/about-adult-social-care) or contact their Adult Social Care Hub for advice and support.", "context": ""}

